import React from 'react';
import clientInputBox from '../../components/clientInputBox/clientInputBox';
import PatientView from '../../components/patientView/patientView';
import classes from './MainPageCockpit.module.css';
import ExportCSV from '../../components/ExportCSV/exportCSV';



const mainPageCockpit = (props) =>{

   const patientList = props.clientList.map((currVal) => {
       return <PatientView
       onClick = {() => {props.userClicked(currVal)}}
       key = {currVal[0]} 
       ID = {currVal[0]}
       />
   });

   let clientListHeader = <h2>Client List</h2>;
        if (props.clientList.length === 0){
        clientListHeader = null;
        }


    let csvPatientList = [];
    props.clientList.map((currVal) => {
        csvPatientList.push({PatientID: currVal[0], PBxGoal1: currVal[2], PBxGoal2: currVal[3], PBxGoal3: currVal[4], FBxGoal1: currVal[5], FBxGoal2: currVal[6], CBxGoal1: currVal[7], CBxGoal2: currVal[8], CBxGoal3: currVal[9], CBxGoal4: currVal[10], CBxGoal5: currVal[11]})
    });

    return(
        <div>
            {clientListHeader}
            {patientList}
            <button onClick = {props.addClientRender} className = {classes.Button}>Add Client</button>
            <ExportCSV csvData= {csvPatientList} fileName = "Filos"/>
        </div>
    );
}

export default mainPageCockpit;
